import css from "styled-jsx/css";

export default css`
  ul {
    display: flex;
    width: 60vh;
    justify-content: space-around;
    list-style: none;
    font-family: Verdana;
    border-bottom: 1px solid lightgrey;
  }

  a {
    text-decoration: none;
  }

  li {
    padding-top: 2px;
    padding-bottom: 2px;
  }

  li:hover {
    padding-top: 0;
    border-top: 2px solid grey;
    background-color: lightgrey;
    color: white;
  }
`;
